import styled from "styled-components";
import Button from '@mui/material/Button';



function Navigation() {
    let width = window.innerWidth;
    if(width > 768){
        return (
            <>
            <Button>Omg</Button>
             </>);
    }
    return (
        <>
        <Button>nooo</Button>
         </>);
}

  export default Navigation;
